import { Box } from '@material-ui/core';
import React from 'react';
import { MeetTaskBubble } from '../Bubble/MeetTaskBubble';
import { PickMeetingTask } from '../RenderTaskList';

interface InputProps {
  date: number;
  meetingData: PickMeetingTask[];
}

export function MeetingTaskList({ date, meetingData }: InputProps) {
  return (
    <Box padding={'0px 50px'} width={'30%'}>
      {MeetTaskBubble({
        date,
        meetingData
      })}
    </Box>
  );
}
